import  React, { Component } from  'react';
import { BrowserRouter } from  'react-router-dom'
import { Route, Link } from  'react-router-dom'
import  PostList  from  './PostList'
import Homepage from './Homepage'
import VideoPostList from './VideoPostList'
import ImagePostList from './ImagePostList'
import DocPostList from './DocPostList'
import ViewPost from './ViewPost'
import  './App.css';
import './clean-blog.css'
import './main2.css'
import './blog-post.css'

import 'bootstrap/dist/js/bootstrap.bundle.min.js'


const  BaseLayout  = () => (
<div  className="container-fluid">
    <div  className="content">
        <Route  path="/"  exact  component={Homepage}  />
        <Route  path="/posts/"  exact  component={PostList}  />
        <Route  path="/posts/videos"  exact  component={VideoPostList}  />
        <Route  path="/posts/images"  exact  component={ImagePostList}  />
        <Route  path="/posts/doc"  exact  component={DocPostList}  />
        <Route  path="/post/:id"  exact  component={ViewPost}  />
    </div>
</div>
)

class  App  extends  Component {

render() {
    return (
    <BrowserRouter>
        <BaseLayout/>
    </BrowserRouter>
    );
}
}
export  default  App;
